<p>在计算机编程中，数据传输对象 是在 2 个进程中携带数据的对象。因为进程间通信通常用于远程接口的昂贵操作。成本的主体是客户和服务器之间的来回通信时间。为降低这种调用次数，使用 DTO 聚合本来需要多次通信传输的数据</p>
